import React from 'react';

import './TrickCard.css';
const cardFolder= '/cards/'



const TrickCard = ({trick}) => (
    <div className="TrickCard">
        {trick ? (
        <div>
            <div className="activeContainer">
                {trick.map ((card, index) => (
                    <div key="{index}" className="activeItem">
                        <Card style={{ width: '18rem' }}>
                            <Card.Img variant="top" src={process.env.PUBLIC_URL + `${cardFolder}${card}.png`} />
                            <Card.Body>
                                <Card.Title></Card.Title>
                                <Card.Text>
                                </Card.Text>
                                <Button variant="primary"></Button>
                            </Card.Body>
                        </Card>
                    </div>
                   // console.log('user in room: ' + user.name)
                ))}
            </div>
            <h2>Total: {trick.length}</h2>
        </div>
        ) : null }
    </div>
);


export default TrickCard;
